-- Remove the table if it exists
DROP TABLE IF EXISTS products;

-- Create the table
CREATE TABLE products (
    id INTEGER PRIMARY KEY,
    title TEXT NOT NULL,
    subTitle TEXT,
    rating INTEGER,
    imgSrc TEXT,
    listProcessor TEXT,
    listMemory TEXT,
    listStrength TEXT,
    strikeThrough INTEGER,
    price INTEGER
);

